INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('43', '2', '1', '1', 'en_us', '13', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1420773958,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"25\":{\"46\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"headline\":\"Writing a Song that Matters\",\"date1\":\"Jun 23 to 27, 2015\",\"date2\":\"August 29 to September 2, 2015\",\"location\":\"Garrison, New York\",\"body\":\"<p>Please Join me at the beautiful GARRISON INSTITUTE for five days of:<\\/p><ul><\\/ul>\",\"photo1\":[\"47\"],\"photo2\":[\"52\"],\"photo3\":[\"53\"],\"photo4\":[\"54\"],\"quote\":\"\\\"In the end, the retreat was much more than a songwriting retreat.\\\" \",\"quoteCredit\":\"-W. , 2013\"}}},\"24\":\"\"}}', '2015-01-28 03:42:38', '2015-01-28 03:42:38', '23bf63e9-5dff-45a9-ac4b-8f11ced86d1d');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('44', '2', '1', '1', 'en_us', '14', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1420773958,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"25\":{\"46\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"headline\":\"Writing a Song that Matters\",\"date1\":\"Jun 23 to 27, 2015\",\"date2\":\"August 29 to September 2, 2015\",\"location\":\"Garrison, New York\",\"bulletsIntro\":\"Please Join me at the beautiful GARRISON INSTITUTE for five days of:\",\"bulletPoints1\":[{\"col1\":\"Songwriting\"},{\"col1\":\"Morning Yog\"},{\"col1\":\"Inspiration \"}],\"bulletpoints2\":[{\"col1\":\"Singing\"},{\"col1\":\"Excellent Vegetarian Meals\"},{\"col1\":\"Sweeping Views of the Hudson River\"}],\"body\":\"<p>This workshop is for anyone that wants to write a song that counts: for ourselves, for the people (or pets) we love and for the world. Our songs can be funny, heavy, catchy or sappy! We\'ll just be looking for ways to say what we really want to say. <\\/p><ul><\\/ul>\",\"photo1\":[\"47\"],\"photo2\":[\"52\"],\"photo3\":[\"53\"],\"photo4\":[\"54\"],\"quote\":\"\\\"In the end, the retreat was much more than a songwriting retreat.\\\" \",\"quoteCredit\":\"-W. , 2013\"}}},\"24\":\"\"}}', '2015-01-28 04:42:33', '2015-01-28 04:42:33', 'f70501e7-43a1-4536-a513-0b9567f28907');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('45', '2', '1', '1', 'en_us', '15', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1420773958,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"25\":{\"46\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"headline\":\"Writing a Song that Matters\",\"date1\":\"Jun 23 to 27, 2015\",\"date2\":\"August 29 to September 2, 2015\",\"location\":\"Garrison, New York\",\"bulletsIntro\":\"Please Join me at the beautiful GARRISON INSTITUTE for five days of:\",\"bulletPoints1\":[{\"col1\":\"Songwriting\"},{\"col1\":\"Morning Yog\"},{\"col1\":\"Inspiration \"}],\"bulletpoints2\":[{\"col1\":\"Singing\"},{\"col1\":\"Excellent Vegetarian Meals\"},{\"col1\":\"Sweeping Views of the Hudson River\"}],\"body\":\"<p>This workshop is for anyone that wants to write a song that counts: for ourselves, for the people (or pets) we love and for the world. Our songs can be funny, heavy, catchy or sappy! We\'ll just be looking for ways to say what we really want to say. <\\/p><ul><\\/ul>\",\"photo1\":[\"47\"],\"photo2\":[\"52\"],\"photo3\":[\"53\"],\"photo4\":[\"54\"],\"quote\":\"\\\"In the end, the retreat was much more than a songwriting retreat.\\\" \",\"quoteCredit\":\"-W. , 2013\"}}},\"24\":\"\",\"37\":{\"new1\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"pattern\":[\"55\"],\"body\":\"<p>\\r\\n\\tWe\'ll explore everything from the bag of tricks we use in songwriting to discussions of why we need to write in the first place, how we can stay the course in writing, and how we can finish our songs, no matter how discouraging the voices in our heads might be.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tPlease fill in the application, including a note about why you\'d like to attend, and we\'ll let you know ASAP if you\'re in. Space is limited to 32 people.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tYou don\'t have to send a song, but I ask that you have completed one whole song at some point in your life. It\'s important for me to know that you have experienced that spark of excitement about songwriting. A trunkful of half-written songs is fine, too.<span><\\/span>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI will be joined by musicians who will be around and available for one on one help tweaking lyrics and coming up with interesting music twists.<span><\\/span>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>I\'m looking forward to it. See you soon!<\\/strong>\\r\\n\\t<strong>Best, Dar<\\/strong>\\r\\n<\\/p>\",\"pricing\":\"\",\"firstRetreat\":\"\",\"secondRetreat\":\"\",\"quote\":\"\",\"sidePattern\":\"\",\"photo1\":\"\",\"photo2\":\"\"}}}}}', '2015-01-28 05:13:58', '2015-01-28 05:13:58', '2167d80f-f9f5-4eaf-8b2c-9db46616be17');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('46', '2', '1', '1', 'en_us', '16', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1420773958,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"25\":{\"46\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"headline\":\"Writing a Song that Matters\",\"date1\":\"Jun 23 to 27, 2015\",\"date2\":\"August 29 to September 2, 2015\",\"location\":\"Garrison, New York\",\"bulletsIntro\":\"Please Join me at the beautiful GARRISON INSTITUTE for five days of:\",\"bulletPoints1\":[{\"col1\":\"Songwriting\"},{\"col1\":\"Morning Yog\"},{\"col1\":\"Inspiration \"}],\"bulletpoints2\":[{\"col1\":\"Singing\"},{\"col1\":\"Excellent Vegetarian Meals\"},{\"col1\":\"Sweeping Views of the Hudson River\"}],\"body\":\"<p>This workshop is for anyone that wants to write a song that counts: for ourselves, for the people (or pets) we love and for the world. Our songs can be funny, heavy, catchy or sappy! We\'ll just be looking for ways to say what we really want to say. <\\/p><ul><\\/ul>\",\"photo1\":[\"47\"],\"photo2\":[\"52\"],\"photo3\":[\"53\"],\"photo4\":[\"54\"],\"quote\":\"\\\"In the end, the retreat was much more than a songwriting retreat.\\\" \",\"quoteCredit\":\"-W. , 2013\"}}},\"24\":\"\",\"37\":{\"56\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"pattern\":[\"55\"],\"body\":\"<p>\\r\\n\\tWe\'ll explore everything from the bag of tricks we use in songwriting to discussions of why we need to write in the first place, how we can stay the course in writing, and how we can finish our songs, no matter how discouraging the voices in our heads might be.\\r\\n<\\/p><p>\\r\\n\\tPlease fill in the application, including a note about why you\'d like to attend, and we\'ll let you know ASAP if you\'re in. Space is limited to 32 people.\\r\\n<\\/p><p>\\r\\n\\tYou don\'t have to send a song, but I ask that you have completed one whole song at some point in your life. It\'s important for me to know that you have experienced that spark of excitement about songwriting. A trunkful of half-written songs is fine, too.\\r\\n<\\/p><p>\\r\\n\\tI will be joined by musicians who will be around and available for one on one help tweaking lyrics and coming up with interesting music twists.\\r\\n<\\/p><p>\\r\\n\\t<strong>I\'m looking forward to it. See you soon!<\\/strong> <\\/p><p>\\t<strong>Best, Dar<\\/strong>\\r\\n<\\/p>\",\"pricing\":\"\",\"firstRetreat\":\"\",\"secondRetreat\":\"\",\"quote\":\"\",\"sidePattern\":\"\",\"photo1\":\"\",\"photo2\":\"\"}}}}}', '2015-01-28 05:14:14', '2015-01-28 05:14:14', '76710462-6499-4520-b75f-26a430ed24fe');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('47', '2', '1', '1', 'en_us', '17', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1420773958,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"25\":{\"46\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"headline\":\"Writing a Song that Matters\",\"date1\":\"Jun 23 to 27, 2015\",\"date2\":\"August 29 to September 2, 2015\",\"location\":\"Garrison, New York\",\"bulletsIntro\":\"Please Join me at the beautiful GARRISON INSTITUTE for five days of:\",\"bulletPoints1\":[{\"col1\":\"Songwriting\"},{\"col1\":\"Morning Yog\"},{\"col1\":\"Inspiration \"}],\"bulletpoints2\":[{\"col1\":\"Singing\"},{\"col1\":\"Excellent Vegetarian Meals\"},{\"col1\":\"Sweeping Views of the Hudson River\"}],\"body\":\"<p>This workshop is for anyone that wants to write a song that counts: for ourselves, for the people (or pets) we love and for the world. Our songs can be funny, heavy, catchy or sappy! We\'ll just be looking for ways to say what we really want to say. <\\/p><ul><\\/ul>\",\"photo1\":[\"47\"],\"photo2\":[\"52\"],\"photo3\":[\"53\"],\"photo4\":[\"54\"],\"quote\":\"\\\"In the end, the retreat was much more than a songwriting retreat.\\\" \",\"quoteCredit\":\"-W. , 2013\"}}},\"24\":\"\",\"37\":{\"56\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"pattern\":[\"55\"],\"body\":\"<p>\\r\\n\\tWe\'ll explore everything from the bag of tricks we use in songwriting to discussions of why we need to write in the first place, how we can stay the course in writing, and how we can finish our songs, no matter how discouraging the voices in our heads might be.\\r\\n<\\/p><p>\\r\\n\\tPlease fill in the application, including a note about why you\'d like to attend, and we\'ll let you know ASAP if you\'re in. Space is limited to 32 people.\\r\\n<\\/p><p>\\r\\n\\tYou don\'t have to send a song, but I ask that you have completed one whole song at some point in your life. It\'s important for me to know that you have experienced that spark of excitement about songwriting. A trunkful of half-written songs is fine, too.\\r\\n<\\/p><p>\\r\\n\\tI will be joined by musicians who will be around and available for one on one help tweaking lyrics and coming up with interesting music twists.\\r\\n<\\/p><p>\\r\\n\\t<strong>I\'m looking forward to it. See you soon!<\\/strong> <\\/p><p>\\t<strong>Best, Dar<\\/strong>\\r\\n<\\/p>\",\"pricing\":\"PRICING: Workshop, Meals & Lodging \",\"firstRetreat\":\"<p><br><\\/p>\",\"secondRetreat\":\"\",\"quote\":\"\",\"sidePattern\":[\"55\"],\"photo1\":\"\",\"photo2\":\"\"}}}}}', '2015-01-28 05:17:16', '2015-01-28 05:17:16', '390b6043-6ce3-48d9-9bcb-ca96c323606b');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('48', '2', '1', '1', 'en_us', '18', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1420773958,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"25\":{\"46\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"headline\":\"Writing a Song that Matters\",\"date1\":\"Jun 23 to 27, 2015\",\"date2\":\"August 29 to September 2, 2015\",\"location\":\"Garrison, New York\",\"bulletsIntro\":\"Please Join me at the beautiful GARRISON INSTITUTE for five days of:\",\"bulletPoints1\":[{\"col1\":\"Songwriting\"},{\"col1\":\"Morning Yog\"},{\"col1\":\"Inspiration \"}],\"bulletpoints2\":[{\"col1\":\"Singing\"},{\"col1\":\"Excellent Vegetarian Meals\"},{\"col1\":\"Sweeping Views of the Hudson River\"}],\"body\":\"<p>This workshop is for anyone that wants to write a song that counts: for ourselves, for the people (or pets) we love and for the world. Our songs can be funny, heavy, catchy or sappy! We\'ll just be looking for ways to say what we really want to say. <\\/p><ul><\\/ul>\",\"photo1\":[\"47\"],\"photo2\":[\"52\"],\"photo3\":[\"53\"],\"photo4\":[\"54\"],\"quote\":\"\\\"In the end, the retreat was much more than a songwriting retreat.\\\" \",\"quoteCredit\":\"-W. , 2013\"}}},\"24\":\"\",\"37\":{\"56\":{\"type\":\"block\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tWe\'ll explore everything from the bag of tricks we use in songwriting to discussions of why we need to write in the first place, how we can stay the course in writing, and how we can finish our songs, no matter how discouraging the voices in our heads might be.\\r\\n<\\/p><p>\\r\\n\\tPlease fill in the application, including a note about why you\'d like to attend, and we\'ll let you know ASAP if you\'re in. Space is limited to 32 people.\\r\\n<\\/p><p>\\r\\n\\tYou don\'t have to send a song, but I ask that you have completed one whole song at some point in your life. It\'s important for me to know that you have experienced that spark of excitement about songwriting. A trunkful of half-written songs is fine, too.\\r\\n<\\/p><p>\\r\\n\\tI will be joined by musicians who will be around and available for one on one help tweaking lyrics and coming up with interesting music twists.\\r\\n<\\/p><p>\\r\\n\\t<strong>I\'m looking forward to it. See you soon!<\\/strong> <\\/p><p>\\t<strong>Best, Dar<\\/strong>\\r\\n<\\/p>\",\"pricing\":\"PRICING: Workshop, Meals & Lodging \",\"registrationInfo\":\"Early bird registration: $1500 \\/ Regular registration: $1700\",\"firstRetreatTitle\":\"FIRST RETREAT \\/ JUNE 23\\u201327\",\"firstRetreat\":\"<p>(early bird deadline is April 10)<\\/p><p>If there are still slots open after March 20th, those registrants will sign up at regular pricing. All applications need to be in by May 1.<span><\\/span><br><\\/p>\",\"secondRetreatTitle\":\"SEONCD RETREAT \\/ AUGUST 29\\u2013SEPTEMBER 2\",\"secondRetreat\":\"<p>(early bird deadline is May 10),<\\/p><p>All applications need to be in by July 1. Same pricing is in place for each retreat.<span><\\/span><\\/p>\",\"quote\":\"\",\"photo1\":\"\",\"photo2\":\"\",\"pattern\":[\"55\"],\"lodgingTitle\":\"Lodging is simple:\",\"lodging\":\"<p>Single rooms and shared baths. There are no locks on the doors, but there are places to keep valuables. We do have cell reception.<span><\\/span><\\/p><p>You don\'t have to bring your car if you can get to the MTA\'s Metro North Railroad-Hudson Line. Metro North is the excellent commuter train out of New York City. You can take the train along the Hudson River to Garrison and be driven right to the Institute a mile away<span><\\/span><br><\\/p>\",\"registrationTitle\":\"Registration: \",\"regInfo\":\"<p>First Retreat: Monday, June 23 \\/ 10am\\u20131pm<\\/p><p>Second Retreat: Friday August 29 \\/ 10am\\u20131pm<\\/p><p>We\'ll meet for lunch and get started at 1 pm. Room check out is on Friday, June 27, and Tuesday, September 2, respectively. <\\/p><p>We will end in the late morning.<span><\\/span><\\/p>\"}}}}}', '2015-01-28 05:31:05', '2015-01-28 05:31:05', '4672b48e-f985-48a1-982a-27dc413a0cfd');
