sk that you have completed one whole song at some point in your life. It\'s important for me to know that you have experienced that spark of excitement about songwriting. A trunkful of half-written songs is fine, too.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI will be joined by musicians who will be around and available for one on one help tweaking lyrics and coming up with interesting music twists.\\r\\n<\\/p>\\r\\n<h3>\\r\\n\\t<strong>I\'m looking forward to it. See you soon!<\\/strong>\\r\\n<\\/h3>\\r\\n<h3>\\r\\n\\t\\t<strong>Best, Dar<\\/strong>\\r\\n<\\/h3>\",\"pricing\":\"PRICING: Workshop, Meals & Lodging \",\"registrationInfo\":\"Early bird registration: $1500 \\/ Regular registration: $1700\",\"firstRetreatTitle\":\"FIRST RETREAT \\/ JUNE 23\\u201327\",\"firstRetreat\":\"<p>(early bird deadline is April 10)<\\/p><p>If there are still slots open after March 20th, those registrants will sign up at regular pricing. All applications need to be in by May 1.<br><\\/p>\",\"secondRetreatTitle\":\"SEONCD RETREAT \\/ AUGUST 29\\u2013SEPTEMBER 2\",\"secondRetreat\":\"<p>(early bird deadline is May 10),<\\/p><p>All applications need to be in by July 1. Same pricing is in place for each retreat.<\\/p>\",\"quote\":\"\",\"photo1\":\"\",\"photo2\":\"\",\"pattern\":[\"55\"],\"lodgingTitle\":\"Lodging is simple:\",\"lodging\":\"<p>Single rooms and shared baths. There are no locks on the doors, but there are places to keep valuables. We do have cell reception.<\\/p><p>You don\'t have to bring your car if you can get to the MTA\'s Metro North Railroad-Hudson Line. Metro North is the excellent commuter train out of New York City. You can take the train along the Hudson River to Garrison and be driven right to the Institute a mile away<br><\\/p>\",\"registrationTitle\":\"Registration: \",\"regInfo\":\"<p>First Retreat: Monday, June 23 \\/ 10am\\u20131pm<\\/p><p>Second Retreat: Friday August 29 \\/ 10am\\u20131pm<\\/p><p>We\'ll meet for lunch and get started at 1 pm. Room check out is on Friday, June 27, and Tuesday, September 2, respectively. <\\/p><p>We will end in the late morning.<\\/p>\"}}}}}', '2015-01-28 05:42:06', '2015-01-28 05:42:06', 'be33b5b7-fcf7-42f7-ae93-0d4ea1cde724');
