INSERT INTO `craft_matrixcontent_firstblock` (`id`, `elementId`, `locale`, `field_block_headline`, `field_block_date1`, `field_block_date2`, `field_block_location`, `field_block_body`, `field_block_bulletsIntro`, `field_block_bulletPoints1`, `field_block_bulletpoints2`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '46', 'en_us', 'Writing a Song that Matters', 'Jun 23 to 27, 2015', 'August 29 to September 2, 2015', 'Garrison, New York', '<p>This workshop is for anyone that wants to write a song that counts: for ourselves, for the people (or pets) we love and for the world. Our songs can be funny, heavy, catchy or sappy! We\'ll just be looking for ways to say what we really want to say. </p><ul></ul>', 'Please Join me at the beautiful GARRISON INSTITUTE for five days of:', '[{\"col1\":\"Songwriting\"},{\"col1\":\"Morning Yog\"},{\"col1\":\"Inspiration \"}]', '[{\"col1\":\"Singing\"},{\"col1\":\"Excellent Vegetarian Meals\"},{\"col1\":\"Sweeping Views of the Hudson River\"}]', '2015-01-23 01:14:27', '2015-01-30 04:15:30', '6ca81ae6-9b91-457e-84da-d8b99a59fa5a');



