INSERT INTO `craft_matrixcontent_matrix` (`id`, `elementId`, `locale`, `field_text_text`, `field_image_caption`, `field_quote_quote`, `field_quote_credit`, `field_quote_alignment`, `field_list_list`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('29', '93', 'en_us', '<p>Here is a short list of news with links and working descriptions to help figure out this section:</p><p>Kai Bird\'s (W\'7_) third novel, The Good Spy releases. See the New York Times review here:<br><a href=\"http://www.nytimes.com/2014/05/15/books/kai-birds-the-good-spy-portrays-robert-ames.html?_r=0\">http://www.nytimes.com/2014/05/15/books/kai-birds-...</a><br></p><p>President Obama pays tribute to civil rights leader John Payton (W\'7_)<br><a href=\"http://www.politico.com/politico44/2012/03/obama-pays-tribute-to-naacps-john-payton-118413.html\">http://www.politico.com/politico44/2012/03/obama-p...</a></p><p>Mayor Bloomberg and Ellen Baxter (W\'75) and Founder of Broadway Housing Community (BHC) break ground on SugarHill, BHC\'s landmark Harlem project.</p><p><a href=\"http://www.nyc.gov/portal/site/nycgov/menuitem.c0935b9a57bb4ef3daf2f1c701c789a0/index.jsp?pageID=mayor_press_release&amp;catID=1194&amp;doc_name=http%3A%2F%2Fwww.nyc.gov%2Fhtml%2Fom%2Fhtml%2F2012b%2Fpr266-12.html&amp;cc=unused1978&amp;rc=1194&amp;ndi=1\">http://www.nyc.gov/portal/site/nycgov/menuitem.c09...</a></p><p>Caroline Shaw (W\'0_) receives Pulitzer Prize in Music</p><p><a href=\"http://www.pulitzer.org/citation/2013-Music\">http://www.pulitzer.org/citation/2013-Music</a><br></p><p>Google X\'s first spinout, Flux, will harness data to make for designing better buildings, Jenny Carlile (W\'03) Co-founder, Chris Larosa (W\'03) Product Manager</p><p><a href=\"https://gigaom.com/2014/05/06/google-x-spin-out-flux-is-harnessing-data-to-make-designing-buildings-better/\">https://gigaom.com/2014/05/06/google-x-spin-out-fl...</a><br></p><p><br></p>', NULL, NULL, NULL, NULL, NULL, '2014-10-31 19:33:19', '2015-01-11 21:52:44', '7b962bb5-c38c-4f4d-8d97-d48a41cde582');
