INSERT INTO `craft_matrixcontent_matrix` (`id`, `elementId`, `locale`, `field_text_text`, `field_image_caption`, `field_quote_quote`, `field_quote_credit`, `field_quote_alignment`, `field_list_list`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('36', '140', 'en_us', NULL, NULL, 'If you want to succeed, double your failure rate.', 'Thomas J. Watson Sr.', 'Left', NULL, '2014-12-19 19:21:56', '2015-01-14 22:21:08', '400ba9f5-0c7c-43c6-9a4d-1c8090792315');
INSERT INTO `craft_matrixcontent_matrix` (`id`, `elementId`, `locale`, `field_text_text`, `field_image_caption`, `field_quote_quote`, `field_quote_credit`, `field_quote_alignment`, `field_list_list`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('37', '235', 'en_us', '<p>Vision (Probably needs its own header)</p><p>The Foundation believes that the world is in ongoing need of more humane and effective leaders and that too many students are unable to develop their potential because their experiences, through young adulthood, are too shallow, narrow and conforming.</p><p>By providing the widest range of personal, professional and cultural exposures and the trust, time and support to explore them, the Foundation helps fellows build a personal landscape on which they can test their ideas and ideals.</p><p><br></p>', NULL, NULL, NULL, NULL, NULL, '2015-01-11 20:36:58', '2015-01-14 22:21:08', '91505b09-9dc4-47b2-9108-acfb85d20975');



