INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '11', 'en_us', 'Am I Eligible?', '<p>You must be enrolled at one of our twelve partner institutions (Link), a second semester freshman or sophomore majoring or intending to major in a liberal arts discipline and have at least four  semesters of full-time academic work remaining after the term in which you apply. </p><p>You must also be an American citizen or green card holder (not on an international student visa) and no older than 21 years old on March 1st of the application year. Please contact your Watson campus representative (Link) for complete details. </p>', NULL, NULL, '2014-10-31 17:02:03', '2015-01-15 04:11:02', '9f6faf6e-b7f2-4b2a-b7d4-90279d4e3d97');
INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '12', 'en_us', 'Selection Criteria', '<p>Qualities sought in the selection of Jeannette K. Watson Fellows include: </p><ul><li>Leadership</li><li>Strong academic record</li><li>Curiosity</li><li>Strong communication skills</li><li>Integrity and self-discipline</li><li>Initiative and follow through</li><li>A team player</li><li>Ambition</li><li>Eagerness to explore different professional fields</li><li>Ability to work in groups</li><li>Interest in social change</li></ul>', NULL, NULL, '2014-10-31 17:02:04', '2015-01-15 04:11:02', 'f00b6775-f3c8-46ee-b0c0-f2480a63f875');
INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('3', '13', 'en_us', 'Application Process', '<p>Each partner institution may nominate up to four candidates to be considered by the Citywide Selection Panel. Our next Selection cycle is March 23 - March 27, 2015. The Fellowship begins with internships the summer following selection.<br></p><p>Application Checklist:</p><p><b>Ensure eligibility<br></b><b>Meet with your campus representative (link)<br></b><b>Complete the application including:</b></p><p>Two Short Essays<br>Two Long Essays<br>Two Recommendations<br>Resume<br>Transcript</p><p><b>Complete the campus selection process<br></b></p><p>If nominated by your institution you will be interviewed during our citywide selection process in the Foundation offices. Please ask your campus representative (link) about your internal application deadlines, typically February, in time for the city selection process in March.<br></p>', NULL, NULL, '2014-10-31 17:02:04', '2015-01-15 04:11:02', '093d47d7-ac41-47f9-ae42-3de1ca88a3f4');
INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('10', '52', 'en_us', '', '', NULL, NULL, '2014-10-31 17:28:05', '2015-01-15 04:13:12', '5b11c2f0-9000-4f05-8be9-27a461f61045');
INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('11', '53', 'en_us', 'Am I Eligible?', '<p>\r\n	You are eligible to apply for the Thomas J. Watson Fellowship if your college or university is a partner<a href=\"http://www.watsonfellowship.org/site/colleges/college.html\"> institution</a>, you are a graduating senior, and your school has nominated you. All majors and fields of inquiry are eligible to apply. Please contact your campus <a href=\"http://www.watsonfellowship.org/site/colleges/liaisons.html\">Watson liaison</a> for details.<br>\r\n</p><p><br></p>', NULL, NULL, '2014-10-31 17:28:05', '2015-01-15 04:13:12', 'ac2534d6-8635-497d-a9e6-07c752b46296');
INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('13', '181', 'en_us', '', '<p><br></p><p><br></p>', NULL, NULL, '2015-01-08 15:27:40', '2015-01-15 04:11:02', 'e5637da8-27dd-47a1-9564-f30357700758');
INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('15', '200', 'en_us', 'Selection Criteria', '<p>Qualities sought in the selection of Thomas J. Watson Fellows include:<br></p><ul><li>Leadership</li><li>Imagination </li><li>Emotional Maturity</li><li>Boldness</li><li>Integrity </li><li>Resourcefulness</li><li>Responsibility</li></ul>', NULL, NULL, '2015-01-09 18:56:28', '2015-01-15 04:13:12', 'a9c5489a-0823-4436-a20b-6f47d1bbc7fb');
INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('17', '204', 'en_us', 'Application Process', '<p>Application Checklist:<br></p><p><b>Ensure eligibility<br></b><b>Meet with your campus representative (Link)<br></b><b><b data-redactor-tag=\"b\">Complete the application including:</b></b></p><p><b>Your Personal Statement<br></b>You should discuss how your talents, concerns and commitments have convinced you to apply for the Watson. The statement may include a description of your background, your college years and your professional aspirations. What do you hope to benefit from the year? The content of the personal statement is up to you, but must not exceed 1500 words.</p><p><b>Your Project Statement</b><br>A Watson project should be conceived from your unique experiences. In fact, the strongest projects could not have been written by anyone else. Describe your plan for the 12-month period.  Traveling independently to unfamiliar places and self-motivating a year of discovery is as challenging as it is enticing. What challenges are intrinsic to <em>your</em> project and how will you address them? When you have lost your passport, you\'re sick, and your best friend is getting married back home, will you still want to stay abroad and continue your project? The content of the project statement is up to you, but must not exceed 1500 words.</p><p><b>2-3 Recommendations<br></b><b>Transcript</b></p><p><b>Complete the campus selection process<br></b>If nominated by your institution you will enter the national pool and be interviewed, on campus, by a representative of the Foundation. Please ask your \r\n	<a href=\"http://www.watsonfellowship.org/site/colleges/liaisons.html\">Watson liaison</a> about your campus deadlines, typically in October, in time for the national process to begin in November.</p><p><br></p>', NULL, NULL, '2015-01-09 19:16:29', '2015-01-15 04:13:12', '10827d73-f4f4-48b4-a9a3-91615e862a48');
INSERT INTO `craft_matrixcontent_overviewmatrix` (`id`, `elementId`, `locale`, `field_block_heading`, `field_block_body`, `field_applicationRequirements_requirements`, `field_applicationRequirements_heading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('18', '205', 'en_us', 'BECOME A WATSON', '', NULL, NULL, '2015-01-09 19:21:54', '2015-01-15 04:11:02', '68904feb-7234-41a8-9620-2d0eb33fd2b1');
