INSERT INTO `craft_matrixcontent_secondblock` (`id`, `elementId`, `locale`, `field_block_body`, `field_block_pricing`, `field_block_firstRetreat`, `field_block_secondRetreat`, `field_block_registrationInfo`, `field_block_firstRetreatTitle`, `field_block_secondRetreatTitle`, `field_block_lodgingTitle`, `field_block_lodging`, `field_block_registrationTitle`, `field_block_regInfo`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '56', 'en_us', '<p>\r\n	We\'ll explore everything from the bag of tricks we use in songwriting to discussions of why we need to write in the first place, how we can stay the course in writing, and how we can finish our songs, no matter how discouraging the voices in our heads might be.\r\n</p><p>\r\n	Please fill in the application, including a note about why you\'d like to attend, and we\'ll let you know ASAP if you\'re in. Space is limited to 32 people.\r\n</p><p>\r\n	You don\'t have to send a song, but I ask that you have completed one whole song at some point in your life. It\'s important for me to know that you have experienced that spark of excitement about songwriting. A trunkful of half-written songs is fine, too.\r\n</p><p>\r\n	I will be joined by musicians who will be around and available for one on one help tweaking lyrics and coming up with interesting music twists.\r\n</p><h6>\r\n<strong>I\'m looking forward to it. See you soon!</strong>\r\n</h6><h6>\r\n<strong>Best, Dar</strong>\r\n</h6>', 'PRICING: Workshop, Meals & Lodging ', '<p>(early bird deadline is April 10)</p><p>If there are still slots open after March 20th, those registrants will sign up at regular pricing. All applications need to be in by May 1.<br></p>', '<p>(early bird deadline is May 10),</p><p>All applications need to be in by July 1. Same pricing is in place for each retreat.</p>', 'Early bird registration: $1500 / Regular registration: $1700', 'FIRST RETREAT / JUNE 23–27', 'SEONCD RETREAT / AUGUST 29–SEPTEMBER 2', 'Lodging is simple:', '<p>Single rooms and shared baths. There are no locks on the doors, but there are places to keep valuables. We do have cell reception.</p><p>You don\'t have to bring your car if you can get to the MTA\'s Metro North Railroad-Hudson Line. Metro North is the excellent commuter train out of New York City. You can take the train along the Hudson River to Garrison and be driven right to the Institute a mile away<br></p>', 'Registration: ', '<p>First Retreat: Monday, June 23 / 10am–1pm</p><p>Second Retreat: Friday August 29 / 10am–1pm</p><p>We\'ll meet for lunch and get started at 1 pm. Room check out is on Friday, June 27, and Tuesday, September 2, respectively. </p><p>We will end in the late morning.</p>', '2015-01-28 05:13:57', '2015-01-30 04:15:30', '9bce7d3a-3ca5-4358-82cd-621ea3e28be0');



