INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('2', 'field', '37', 'en_us', ' we ll explore everything from the bag of tricks we use in songwriting to discussions of why we need to write in the first place how we can stay the course in writing and how we can finish our songs no matter how discouraging the voices in our heads might be please fill in the application including a note about why you d like to attend and we ll let you know asap if you re in space is limited to 32 people you don t have to send a song but i ask that you have completed one whole song at some point in your life it s important for me to know that you have experienced that spark of excitement about songwriting a trunkful of half written songs is fine too i will be joined by musicians who will be around and available for one on one help tweaking lyrics and coming up with interesting music twists i m looking forward to it see you soon best dar early bird deadline is april 10 if there are still slots open after march 20th those registrants will sign up at regular pricing all applications need to be in by may 1 first retreat june 23 27 single rooms and shared baths there are no locks on the doors but there are places to keep valuables we do have cell reception you don t have to bring your car if you can get to the mta s metro north railroad hudson line metro north is the excellent commuter train out of new york city you can take the train along the hudson river to garrison and be driven right to the institute a mile away lodging is simple pattern home 2x circle 2x 1 plant 2x pricing workshop meals lodging quote2 first retreat monday june 23 10am 1pmsecond retreat friday august 29 10am 1pmwe ll meet for lunch and get started at 1 pm room check out is on friday june 27 and tuesday september 2 respectively we will end in the late morning early bird registration $1500 regular registration $1700 registration early bird deadline is may 10 all applications need to be in by july 1 same pricing is in place for each retreat seoncd retreat august 29 september 2 ');
